def multiply(a, b):
    return a * b


def divide(a, b):
    return a / b


def factorial(a):
    if (a == 0):
        return 1
    else:
        return a * factorial(a - 1)


def gcd(a, b):
    while b:
        a, b = b, a % b
    return a


def exp(a, b):
    return a**b


def mean(nums):
    sum = 0
    for i in range(len(nums)):
        sum += nums[i]

    return float(float(sum) / float((len(nums))))


def median(nums):
    length = len(nums)
    nums.sort()
    return nums[length / 2]


